import React from 'react'
import st from './Dialogs.module.css'
import {NavLink} from "react-router-dom"

const DialogItem = (props) => {
    return (
        <div className={st.item}>
            <NavLink to={'/messages/' + props.id} activeClassName={st.active}>{props.name}</NavLink>
        </div>
    )
}

const Message = (props) => {
    return (
        <div className={st.message_item}>{props.item}</div>

    )
}

const Dialogs = (props) => {
    let myUsers = [
        {id: '1', name: 'Elena'},
        {id: '2', name: 'Alice'},
        {id: '3', name: 'Sergei'},
        {id: '4', name: 'Irina'},
        {id: '5', name: 'Tamara'}
    ]
    let allMessages = [
        {
            from: Elena,
            to: Alice,
            message: 'Hello. how are you?',
            date: '25.06.20'
        },
        {
            from: Alice,
            to: Elena,
            message: 'Hello. I am fine. What about you?',
            date: '25.06.20'
        },
        {
            from: Elena,
            to: Tamara,
            message: 'Hello. how are you?',
            date: '26.06.20'
        }
    ]

    return (
        <div className={st.dialogs}>
            <div className={st.dialogs_items}>
                {myUsers.map((element) => {
                    return (
                        <DialogItem name={element.name} id={element.id} key={element.id}/>
                    )
                })}

            </div>
            <div className={st.messages}>
                {allMessages.map((element)=> {
                    return (
                        <Message item={element.date + ' ' +'From ' + element.from + ' to ' + element.to +' : ' + element.message}/>
                    )
                })}

            </div>
        </div>
    )
}
export default Dialogs
